import logo from './logo.svg';
import './App.css';

var myQuery = window.encoderURI(document.getElementById('searchInput').value)


function App() {
  return (
    <div id="root">
      <input type="text" id="searchInput"></input>
      <button onClick={search}>Search</button>
    </div>
  );
}

function search() {
  console.log(myQuery);
  window.location.assign("https://www.google.com/search?q=" + myQuery);
}


export default App;
